Here is a Python program that prints out the first 100 prime numbers:
```
def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

for i in range(1, 101):
    if is_prime(i):
        print(i)
```
This program uses the Sieve of Eratosthenes algorithm to find prime numbers up to 100. The `is_prime` function takes a number `n` and checks whether it is prime by iterating through all the numbers from 2 to the square root of `n`, and checking if any of them divide evenly into `n`. If none of them do, then `n` is prime.

The program then uses this function to print out the first 100 prime numbers.

You can also use the `sympy` library in Python to find prime numbers:
```
from sympy import sieve

for i in range(1, 101):
    if sieve.isprime(i):
        print(i)
```
This code is more concise and easier to read than the previous one, but it may be slower for large inputs.
